import React from "react"
import axios from "axios"
export default async function Moderateur() {
    return await axios.post("http://localhost:4000/clients/estmoderateur", {},{
        headers: {
          Authorization: "bearer " + localStorage.getItem("jwt-cookie")
    }})
}
